import React, { Component } from 'react';


export default function Oval(props) {
    console.log(props)
    let styleType = props.styleType;
    let textName = props.textName

    let hoverHandler = () => {
        styleType = 'ux-hover'
    }

    return (
        <div onHover={hoverHandler} className={styleType + " oval"}>
            <h3>{textName}</h3>
        </div>

    )
}
